import React from "react";
//import { withRouter } from 'react-router-dom';
import { Nav, Navbar, NavItem } from 'react-bootstrap'
import { Container } from "react-bootstrap/lib/Tab";

import "../navigation/navigation.css";
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css'

export class CommunicatorNavigation extends React.Component {
  render() {
    return (
      <Navbar expand="md" className="navbar navbar-inverse menu-background sht-navbar">
        <Nav expand="md" className="mr-auto">
          <NavItem href="/default">Home</NavItem>
          <NavItem href="#">Features</NavItem>
          <NavItem href="#">Pricing</NavItem>
        </Nav>
      </Navbar>
    )
  }
}
